import React, { Component } from 'react';
import { Menu, Icon } from 'antd';
const SubMenu = Menu.SubMenu;

class NavLeft extends Component {
  render() {
    return (
      <div>
        <div className="logo">
          <img src="" alt="logo"/>
          <h1>AntD MS</h1>
        </div>
        <Menu>
          <SubMenu 
            key="sub1" 
            title={
              <span>
                <Icon type="mail" />
                <span>Navigation One</span>
                  </span>
            }
          ></SubMenu>
        </Menu>
      </div>
    )
  }
}

export default NavLeft;
